-- Factor type changes
begin

UPDATE CSR.FACTOR_TYPE SET PARENT_ID = 15063 WHERE PARENT_ID = 13031 AND FACTOR_TYPE_ID <> 15063;
UPDATE CSR.FACTOR_TYPE SET PARENT_ID = 15064 WHERE PARENT_ID = 13498 AND FACTOR_TYPE_ID <> 15064;


UPDATE CSR.FACTOR_TYPE SET NAME = REPLACE(NAME, 'Patent Stationary Fuel', 'Patent Fuel') WHERE NAME LIKE 'Stationary Fuel - Patent Stationary Fuel%';
UPDATE CSR.FACTOR_TYPE SET NAME = REPLACE(NAME, 'Patent Transport Fuel', 'Patent Fuel') WHERE NAME LIKE 'Transport Fuel - Patent Transport Fuel%';
UPDATE CSR.FACTOR_TYPE SET NAME = REPLACE(NAME, 'Recycled Stationary Fuel Oil', 'Recycled Fuel Oil') WHERE NAME LIKE 'Stationary Fuel - Recycled Stationary Fuel Oil%';
UPDATE CSR.FACTOR_TYPE SET NAME = REPLACE(NAME, 'Waste Oil & Distillate Oil Blend Blend', 'Waste Oil & Distillate Oil Blend') WHERE NAME LIKE '%Waste Oil & Distillate Oil Blend Blend%';
end;
